column8:
ミニマルなデザインのナイキ ダウンシフター 7は軽量の単層メッシュ、足裏の柔らかいフォームがまったく新しい快適性を提供。<br><br><br>
軽量なメッシュアッパーで通気性と快適性を実現。継ぎ目のない足中央部のサドルでサポート力が向上。<br>
フルレングスのラバーアウトソールで耐久性とトラクションを強化。<br>フルレングスの立体的なPhylonミッドソールが軽量で弾力性の高いクッショニングを実現。<br>
フレックスグルーブ (アウトソールやミッドソールにある溝) がヒールからつま先まで効率的で自然な動きをサポート。 <br><br><br>
●カラー<br>
(002)ブラック／ホワイト／アンスラサイト<br>(400)ミッドナイトネイビー／ホワイト／ダークオブシディアン／ブラック<br>(004)クールグレー/ボルトダーク/グレーホワイト<br>(600)ユニバーシティレッド／ブラック／ホワイト<br>(007)ウルフグレー／ホワイト／ブラック<br>(401)チロリンブルー／ブラック／バイナリーブルー／ホワイト<br>(800)ハイパーオレンジ／ホワイト／トラックレッド／ブラック<br><br>
●サイズ<br>
24.5cm、25.0cm、25.5cm、26.0cm、26.5cm、27.0cm、27.5cm、28.0cm、28.5cm、29.0cm、29.5cm、30.0cm<br><br>
●素材<br>
アッパー：合成繊維、アウトソール：ゴム底<br><br>
●品番<br>
852459<br><br>
靴幅: 2E（普通）<br><br>
ブランド NIKE<br><br>
